import css from '../style.css'
function MyImage() {
    // eslint-disable-next-line react/react-in-jsx-scope
    return <img className={css.google} src='./google_logo.png' style={{visibility: this.state.check ? 'visible' : 'hidden' }} alt="" height="100vh" width="100vw" />
  }

  export default MyImage
